    <style type="text/css" media="screen">
        body,
        div,
        dl,
        dt,
        dd,
        ul,
        ol,
        li,
        h1,
        h2,
        h3,
        h4,
        h5,
        h6,
        pre,
        code,
        form,
        fieldset,
        legend,
        input,
        textarea,
        p,
        aside,
        blockquote,
        th,
        td,
        span,
        i,
        b,
        img {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
            -webkit-box-sizing: border-box;
            -moz-box-sizing: border-box;
        }
        
        html,
        body {
            min-height: 100%;
            width: 100%;
        }
        
        html {
            -webkit-user-select: none;
            -moz-user-select: none;
            -o-user-select: none;
            user-select: none;
        }
        
        body {
            position: relative;
            -webkit-text-size-adjust: 100%;
        }
        
        :focus {
            outline: 0;
            box-shadow: none
        }
        
        a,
        input,
        select,
        textarea,
        button {
            -webkit-tap-highlight-color: rgba(0, 0, 0, 0);
        }
        
        a {
            text-decoration: none;
            outline: none;
            font-weight: normal;
            border: 0;
        }
        
        table {
            border-collapse: collapse;
            border-spacing: 0;
        }
        
        ol,
        ul,
        li {
            vertical-align: middle;
        }
        
        input,
        textarea {
            outline: none;
            -webkit-appearance: none;
            resize: none;
        }
        
        img,
        button,
        input,
        textarea {
            border: none;
        }
        
        @media screen and ( min-width: 320px) and ( max-width: 359px) {
            html {
                font-size: 14px;
            }
        }
        
        @media screen and ( min-width: 360px) and ( max-width: 374px) {
            html {
                font-size: 13px;
            }
        }
        
        @media screen and ( min-width: 375px) and ( max-width: 479px) {
            html {
                font-size: 15px;
            }
        }
        
        @media screen and ( min-width: 480px) and ( max-width: 539px) {
            html {
                font-size: 17px;
            }
        }
        
        @media screen and ( min-width: 540px) and ( max-width: 639px) {
            html {
                font-size: 19px;
            }
        }
        
        @media screen and ( min-width: 640px) {
            html {
                font-size: 24px;
            }
        }
        
        .m-row {
            display: table;
            width: 100%;
            background: #fff;
        }
        
        .m-row:before {
            content: '';
            display: table-row;
            width: 100%;
        }
        
        .m-row .m-cell {
            display: table-cell;
            vertical-align: middle;
        }
        
        .m-row .m-cell.m-cell-top {
            vertical-align: top;
        }
        
        .float-order-btn {
            display: block;
            width: 100%;
            position: fixed;
            left: 0;
            bottom: 0;
            height: 4.6rem;
            line-height: 3.27rem;
            font-size: 1.2rem;
            text-align: center;
            background-color: rgba(0, 0, 0, 0.7);
        }
        
        .float-order-btn img {
            display: block;
            width: 100%;
        }
